let ProfilePic = (props) => {
    return (
    <img src={props.image}/>
    )
}

let CommentBody = (props) => {
    return (
        <div>
            <strong>{props.username}</strong>
            <div>
                {props.comment}
            </div>
        </div>
        )
}

let Comment = (props) => {
    return (
        <div>
            <ProfilePic image={props.image}/>
            <CommentBody username={props.username} comment={props.comment}/>
        </div>
    )
}

let commentData = [
    {
        image: "data:image/jpeg;base64,",
        username: 'David',
        comment: 'This is my first comment',
    },
    {
        image: "data:image/jpeg;base64,",
        username: 'Joe',
        comment: 'hello world',
    },
    {
        image: "data:image/jpeg;base64,",
        username: 'Yolanda',
        comment: 'blah blah blah',
    },
    {
        image: "data:image/jpeg;base64,",
        username: 'Trippy',
        comment: 'Am I freaking you out?'
    }
]

const commentList = commentData.map(commentData => {
    return <ul><Comment {...commentData}/></ul>
    //another way to do the funtion is {Comment(commentData)}
})

let Comments = () => {
    return (
        <ul>{commentList}</ul>
    )
}

ReactDOM.render(<Comments />, document.getElementById('root'))